import React, { Component, Fragment } from 'react';
import { Jumbotron, Qoute, Button} from "./components/bootstrap";

class App extends Component {
  qoute = {
    text: `Life is 10% what happens to me and 90% of how I react to it.`,
    soure: "Charles Swindoll"
  }

  render() {
    return (
      <Fragment>
        <Jumbotron title="Qoute of the day" width={"550px"}>
          <Qoute text={this.qoute.text} source={this.qoute.soure}>
            By
          </Qoute>

          <div className="row">
            <div className="col-sm">
              <Button name="New qoute"/>
            </div>

            <div className="col-sm flex-end">
              <Button name="New qoute"/>
            </div>
          </div>


        </Jumbotron>
      </Fragment>
    );
  }
}

export default App;
